import React from 'react';
import './Header.css';
import Logo from '../Components/Images/LOGO.png'; // Import the Logo component
import 'bootstrap/dist/css/bootstrap.min.css';

const Header = () => {
  return (
    <header>
      <div>
        <div>
          <img src ={Logo}/>
        </div>
      </div>
      <h1>Project Module Management System</h1>
    </header>
  );
}

export default Header;
